TITLE:
  - 'Test case for scatra-thermo interaction involving electrochemistry and electrode-electrolyte interface
    coupling:'
  - '- based on results in Taralov et al., Berichte des Fraunhofer ITWM, Nr. 221 (2012)'
  - '- two-dimensional problem with two one-dimensional electrode-electrolyte interfaces'
  - '- four rectangular anode particles, electrolyte, and four rectangular cathode particles, each with'
  - 'constant initial lithium concentrations, electric potentials, and temperatures'
  - '- charge transfer kinetics characterized by Butler-Volmer-Peltier kinetics'
  - '- discharge from partially charged state at C rate of approximately 0.8'
  - '- 2500 quad4 elements with matching interface nodes'
  - '- stronger coupling between scatra and thermo fields due to reduced heat conductivities'
  - '- cf. bachelor thesis by Alexander Angerer (2017) for details'
PROBLEM SIZE:
  DIM: 2
PROBLEM TYPE:
  PROBLEMTYPE: "Scalar_Thermo_Interaction"
SCALAR TRANSPORT DYNAMIC:
  SOLVERTYPE: "nonlinear"
  NUMSTEP: 10
  TIMESTEP: 1
  INITIALFIELD: "field_by_condition"
  LINEAR_SOLVER: 1
SCALAR TRANSPORT DYNAMIC/NONLINEAR:
  CONVTOL_OUTER: 1e-08
SCALAR TRANSPORT DYNAMIC/STABILIZATION:
  STABTYPE: "no_stabilization"
  DEFINITION_TAU: "Zero"
  EVALUATION_TAU: "integration_point"
  EVALUATION_MAT: "integration_point"
ELCH CONTROL:
  EQUPOT: "divi"
  DIFFCOND_FORMULATION: true
  INITPOTCALC: true
STI DYNAMIC:
  SCATRATIMINTTYPE: "Elch"
  COUPLINGTYPE: "TwoWay_ScatraToThermo_Aitken"
  THERMO_INITIALFIELD: "field_by_function"
  THERMO_INITFUNCNO: 4
  THERMO_LINEAR_SOLVER: 1
SCALAR TRANSPORT DYNAMIC/S2I COUPLING:
  COUPLINGTYPE: "MatchingNodes"
SOLVER 1:
  SOLVER: "UMFPACK"
